Hi! Ran into a confusing issue with `orderBy` when some but not all of the values for a given field can be `false`. I'll give an example of the issue first and then describe our use case below.


## Example repro

```typescript

// sorting by fields that can be a value or `null` works as expected,
// and sorts the array by `b` asc and then `a` desc

const xs = [
    {a: 4, b: null},
    {a: 5, b: null},
    {a: 7, b: "something"},
    {a: 1, b: "something else"}
]

_.orderBy(xs, ['b', 'a'], ['asc', 'desc'])

// =>
[
  {a: 7, b: "something"},
  {a: 1, b: "something else"}
  {a: 5, b: null},
  {a: 4, b: null},
]

// however, if a value can either be a string or `false`,
// then sorting by that field _doesn't happen at all_:

const ys = [
    {a: 4, b: false},
    {a: 5, b: false},
    {a: 7, b: "something"},
    {a: 1, b: "something else"}
]

_.orderBy(ys, ['b', 'a'], ['asc', 'desc'])

// =>
[
  {a: 7, b: "something"},
  {a: 5, b: false},
  {a: 4, b: false},
  {a: 1, b: "something else"}
]
```

We're sorting an array of objects of different (but related) types using a set of comparator functions. We're also maintaining a sorted list of these objects so we can do membership tests and inserts using binary search to keep things O(log n), as the arrays can end up being very large.

The comparators we're using don't make sense for all the types of object that are in the array. So what we've been doing is have the comparator functions return the relevant field if it exists, or `false` if the comparator is not relevant to the object. However, we noticed that we were sometimes getting duplicates in our array, presumably because the binary search on insert was not finding the correct index in the array. Having dug into it, this behaviour of `lodash`s `orderBy` does seem to be the reason why.

We've changed our implementation to return `null` instead of `false` in these cases, which has fixed things for us in the meantime. But posting an issue in case this is something which can/should be fixed in lodash itself, so it doesn't confuse others like it did us.

Obviously it's questionable whether booleans or strings should come first when ordering an array of booleans and strings, but even if the choice of "booleans first" or "strings first" is mostly arbitrary, it would prevent weird behaviour happening in cases like ours if they were sorted in this way consistently.

Happy to have a crack at fixing this if there's appetite for a PR.

